const prisma = new PrismaClient();


const dummyUsers = async (req: Request, res: Response) => {
    
    // check if there is already anything in the database
    let firstTime = await prisma.note.findMany();

    if(firstTime.length < 1) {
        const userPool = [
            "manny",
            "owen",
            "janessa",
            "josh",
            "keeghan"
        ];
        
        const fillUserTable = (user: string) => {
            let sendData = {
                userName: user
            };
        
            fetch("http://localhost:3000/api/add-user", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json"
                },
                body: JSON.stringify(sendData)
            });
        }
        
        userPool.forEach(fillUserTable);
    
        const data = {
            userPool: userPool
        }
    
        res.status(200).send(data);
    } else {
        res.status(401).send('401 Unauthorized');
    }
}

const dummyNotes = async (req: Request, res: Response) => {

    // check if there is already anything in the database
    let firstTime = await prisma.note.findMany();

    if(firstTime){
        const notesPool = [
            "Soil looks good",
            "need to look at this more",
            "I didnt mean to write a note",
            "Wow this needs to be looked at more",
            "I should have used a different image",
            "I really needed to write this note",
            "Another filler note",
            "I love writing notes",
        ];
    
        const userIds = [
            1,
            2,
            3,
            4,
            5
        ];
    
        const fillNotesTable = (user: number, notes: string[]) => {
            const randomIndex = Math.floor(Math.random() * notes.length);
            const sendData = {
                note: notes[randomIndex],
                userId: user
            }
    
            fetch("http://localhost:3000/api/add-note", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json"
                },
                body: JSON.stringify(sendData)
            })
            .catch(error => console.error("Error:", error));
        }
    
        for( let i = 0; i < userIds.length; i++){
            let curUser = userIds[i];
            for( let i = 0; i < 99; i++){
                fillNotesTable(curUser, notesPool);
            }
        }
    
        const data = {
            notesPool: notesPool,
            userIds: userIds
        }
    
        res.status(200).send(data);
    } else {
        res.status(401).send('401 Unauthorized');
    }
}


const dummyCovRprtData = async (req: Request, res: Response) => {

    // check if there is already anything in the database
    let firstTime = await prisma.coverage_Report.findMany();

    if(firstTime.length < 1){
        // these will need to be added as dataURLs to the database
        const covPicturePool = [
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,",
            "data:image/jpeg;base64,"
        ];

        const userPool = [
            1,
            2,
            3,
            4,
            5
        ];

        const startDate = new Date(2020, 0, 1); // January 1, 2020
        const endDate = new Date(); // Current date

        const covPercentPool = [
            0,
            25,
            50,
            75,
            100
        ]

        const fillCovReports = async (userId: number, noteId: number | null) => {

            const data = {
                img: covPicturePool[Math.floor(Math.random() * covPicturePool.length)],
                num: covPercentPool[Math.floor(Math.random() * covPercentPool.length)],
                user: userId,
                note: noteId,
                date: new Date(startDate.getTime() + Math.random() * (endDate.getTime() - startDate.getTime()))
            }

            const coverageReport = await prisma.coverage_Report.create({
                data: {
                    userId: data.user,
                    noteId: data.note,
                    coverage_picture: data.img,
                    coverage_percentage: data.num,
                    createdAt: data.date
                }
            });
        }

        for( let i = 0; i < userPool.length; i++){
            const userId = userPool[i]
            const notes = await prisma.note.findMany({
                where: {
                    userId: userId
                },
                select: {
                    id: true
                }
            });

            for(let i = 0; i < 500; i++){
                if( i % 5 == 0 && i > 249 ){
                    fillCovReports(userId, notes[ i % 5].id);
                }else {
                    fillCovReports(userId, null);
                }
            }
        }

        const data = {
            pictures: covPicturePool,
            percents: covPercentPool,
            users: userPool,
            startDate: startDate,
            endDate: endDate
        }

        res.status(200).send(data)
    } else {
        res.status(401).send('401 Unauthorized');
    }
}


const dummyOMARprtData = async (req: Request, res: Response) => {

    // check if there is already anything in the database
    let firstTime = await prisma.oMA_Report.findMany();

    if(firstTime.length < 1){
        const huePool = [
            '2YR',
            '3.5YR',
            '0.5RP',
            '4RP',
            '10YR ',
            '2.5PB',
            '2.5Y ',
            '7.5YR',
            '5GY',
            '7.5R'
        ];
    
        const userPool = [
            1,
            2,
            3,
            4,
            5
        ];
    
        const startDate = new Date(2020, 0, 1); // January 1, 2020
        const endDate = new Date(); // Current date
    
        const covPercentPool = [
            0,
            25,
            50,
            75,
            100
        ]
    
        const minValue = 2.5;
        const maxValue = 8;
    
        const minChroma = 1;
        const maxChroma = 8;
    
        const fillOMAReports = async (userId: number, noteId: number | null) => {
    
            const randomValue = parseFloat((Math.random() * (maxValue - minValue) + minValue).toFixed(2));
            const randomChroma = parseFloat((Math.random() * (maxChroma - minChroma) + minChroma).toFixed(2));
    
            const data = {
                hue: huePool[Math.floor(Math.random() * huePool.length)],
                value: randomValue,
                chroma: randomChroma,
                user: userId,
                note: noteId,
                date: new Date(startDate.getTime() + Math.random() * (endDate.getTime() - startDate.getTime()))
            }
    
            const OMAReport = await prisma.oMA_Report.create({
                data: {
                    userId: data.user,
                    noteId: data.note,
                    hue: data.hue,
                    value: data.value,
                    chroma: data.chroma,
                    createdAt: data.date
                }
            });
        }
    
        for( let i = 0; i < userPool.length; i++){
            const userId = userPool[i]
            const notes = await prisma.note.findMany({
                where: {
                    userId: userId
                },
                select: {
                    id: true
                }
            });
    
            for(let i = 0; i < 500; i++){
                if( i % 5 == 0 && i < 249 ){
                    fillOMAReports(userId, notes[ i % 5].id);
                }else {
                    fillOMAReports(userId, null);
                }
            }
        }
    
        const data = {
            hues: huePool,
            values_range: [minValue, minChroma],
            chromas_range: [minChroma, maxChroma],
            users: userPool,
            startDate: startDate,
            endDate: endDate
        }
    
        res.status(200).send(data)
    } else {
        res.status(401).send('401 Unauthorized');
    }
}

